import React, { useEffect } from 'react';
import network from '../utils/network';

const HomePage = (props:any) => {
  useEffect(()=>{
    const getData = async() => {
      const res = await network.getSeaData();

      console.log(res);
    }

  }, []);

  return <div>Welcome to Next.js!</div>
}


